import { Card, Button } from "react-bootstrap";
import { useHistory, useParams } from "react-router-dom";
import { escapeLeadingUnderscores } from "typescript";
import { SiteContext } from "../../context";
import { ICompanyData } from "../../types";

interface CompanyCardProps {
  companyInfo: ICompanyData[],

}

const CompanyCard = ({ companyInfo }: CompanyCardProps) => {



  if (!toCompare) {
  return (
      <>
      { companyInfo?.map((c: ICompanyData) => {
            return (
              <div className="col-md-3  mt-5 ml-5">
              <Card style={{ width: '100%',minHeight:"400px" }}>
                <Card.Body>
                  <Card.Title>{c.name}</Card.Title>
                  <Card.Subtitle>VAT:</Card.Subtitle>
                  <Card.Text> {c.vat} </Card.Text>
                  <Card.Subtitle>Adress:</Card.Subtitle>
                  <Card.Text>{c.address}</Card.Text>
                  <Card.Subtitle>Publishing Date:</Card.Subtitle>
                  <Card.Text>{c.depositDate}</Card.Text>
                  <Card.Subtitle>Equity: </Card.Subtitle>
                  <Card.Text>{c.equitity}</Card.Text>
                  <Card.Subtitle>Debts:</Card.Subtitle>
                  <Card.Text>{c.debt}</Card.Text>
                  <Card.Subtitle>Profit:</Card.Subtitle>
                  <Card.Text>{c.companyProfit}</Card.Text>
                </Card.Body>
              </Card>
              </div>
            )
          }
          )
      }
 </>
  )} else 
  {  return (   
    <>
    { companyInfo?.map((c: ICompanyData) => {
      let i = companyInfo.indexOf(c);
          return (
            <div className="col-md-3  mt-5 ml-5">
            <Card style={{ width: '100%',minHeight:"400px" }}>
              <Card.Body>
                <Card.Title>{c.name}</Card.Title>
                <Card.Subtitle>VAT:</Card.Subtitle>
                <Card.Text> {c.vat} </Card.Text>
                <Card.Subtitle>Adress:</Card.Subtitle>
                <Card.Text>{c.address}</Card.Text>
                <Card.Subtitle>Publishing Date:</Card.Subtitle>
                <Card.Text>{c.depositDate}</Card.Text>
                <Card.Subtitle>Equity: </Card.Subtitle>
                <Card.Text style={{ color: compareColorArray[i].equitityColor}}>{c.equitity}</Card.Text>
                <Card.Subtitle>Debts:</Card.Subtitle>
                <Card.Text style={{ color: compareColorArray[i].debtColor}}>{c.debt}</Card.Text>
                <Card.Subtitle>Profit:</Card.Subtitle>
                <Card.Text style={{ color: compareColorArray[i].companyProfitColor}}>{c.companyProfit}</Card.Text>
              </Card.Body>
            </Card>
            </div>
          )
        }
        )
    }

</>)
}

}
export default CompanyCard;
